    false,nt"url": null,nt"notes": "All open garbage cart requests made to
    311 and all requests completed since January 1, 2011. The City of Chicago provides
    heavy-duty plastic 96-gallon garbage carts to single-family residences and apartment
    buildings of four units or less. Residents may request new carts when none are present,
    or replacement carts for ones which have gone missing or been damaged.     rn311
    sometimes receives duplicate requests for garbage carts. Requests that have been
    labeled as Duplicates are in the same geographic area and have been entered into
    311u2019s Customer Service Requests (CSR) system at around the same time as a previous
    request. Duplicate reports/requests are labeled as such in the Status field, as
    either "Open - Dup" or "Completed - Dup." Data is updated daily.",nt"owner_org":
